import './App.css';
import React from 'react';
import jokesdata from './components/jokesdata';
import Jokes from './components/jokes';
import datas  from './components/data';
import Card from './components/Card';

function App() {
  const jokeElements = jokesdata.map((joke) => (
    <Jokes setup={joke.setup} punchline={joke.punchline} />
  ));
  const cardelem= datas.map((data)=>(
    <Card coverImg={data.coverImg} 
          stats={data.stats.rating}
          revcount={data.stats.revcount}
          location={data.location}
          title={data.title}
          price={data.price}

    />

  ))

  return (
    <div className="App">
      <div className='air'> <img src="./img/air.png" className="hero--img" /> </div>
      {cardelem}


    </div>
  );
}

export default App;
